import { useState } from "react";
import { useHistory, Link } from "react-router-dom";

import form from "./SignInForm.module.css";

function SignInForm() {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");


  const redirect = useHistory();

  const onSubmitR = (event) => {
    event.preventDefault();
    redirect.push("/signup");
  };

  const onSubmitL = (event) => {
    event.preventDefault();


      const bruker = { email, password };

      fetch("http://localhost:8080", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(bruker),
      }).then(() => {
        console.log("new registration");
        redirect.push("/profile");
      });

  };

  const validatePassword = (pass, pass2) => {
    if (pass !== pass2) {
      return true;
    }
  };

  return (
    <div>
      <div className={form.column_left}>
        <form onSubmit={onSubmitL} className={form.form}>
          <h1>Sign in</h1>
          <div>
            <label>
              <h2>Email</h2>
              <input
                type="email"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
              />
            </label>
          </div>

          <div>
            <label>
              <h2>Password</h2>
              <input
                type="password"
                value={password}
                required
                onChange={(e) => setPassword(e.target.value)}
              />
            </label>
          </div>

          <input type="submit" className={form.btn_left} value="Log in" />
        </form>
      </div>
